import React, { useState, useEffect } from 'react';
import { getCommonIngredients } from '../services/api';

function CommonIngredients() {
  const [ingredients, setIngredients] = useState([]);

  useEffect(() => {
    getCommonIngredients()
      .then(response => setIngredients(response.data))
      .catch(error => console.error('Error fetching common ingredients:', error));
  }, []);

  return (
    <div>
      <h2>Most Common Ingredients</h2>
      <ul>
        {ingredients.map((item, index) => (
          <li key={index}>{item.ingredients}: {item.count}</li>
        ))}
      </ul>
    </div>
  );
}

export default CommonIngredients;
